prompt --application/shared_components/plugins/region_type/com_fos_plugin_preview
begin
--   Manifest
--     PLUGIN: COM.FOS.PLUGIN_PREVIEW
--   Manifest End
wwv_flow_api.component_begin (
 p_version_yyyy_mm_dd=>'2021.04.15'
,p_release=>'21.1.6'
,p_default_workspace_id=>9869175406039007
,p_default_application_id=>100
,p_default_id_offset=>0
,p_default_owner=>'APEX_APP'
);
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(18650767290714039)
,p_plugin_type=>'REGION TYPE'
,p_name=>'COM.FOS.PLUGIN_PREVIEW'
,p_display_name=>'FOS Demo - Plug-in Settings Preview'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('REGION TYPE','COM.FOS.PLUGIN_PREVIEW'),'')
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
