''))
,p_css_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#css/style.min.css',
'#PLUGIN_FILES#css/tabs.min.css',
'#PLUGIN_FILES#css/tree.min.css'))
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- =============================================================================',
'--',
'--  FOS = FOEX Open Source (fos.world), by FOEX GmbH, Austria (www.foex.at)',
'--',
'--  This plug-in shows other settings of other plug-ins like page designer.',
'--',
'--  License: restricted - for FOS internal use only',
'--',
'--  GitHub: -',
'--',
'-- =============================================================================',
'',
'--------------------------------------------------------------------------------',
'function get_page_data',
'  ( p_mode        in varchar2',
'  , p_inc_values  in varchar2',
'  , p_app_id      in varchar2',
'  , p_page_id     in varchar2',
'  , p_val_page_id in varchar2',
'  , p_plugin_name in varchar2',
'  , p_instance_id in varchar2 ',
'  )',
'return clob',
'as',
'    l_result            clob;',
'    l_app_id            varchar2(100) := p_app_id;',
'    l_page_id           varchar2(100);',
'',
'    l_plugin_type       varchar2(100);',
'',
'    cursor_regions      sys_refcursor;',
'    cursor_region_cols  sys_refcursor;',
'    cursor_cls_rpt_cols sys_refcursor;',
'    cursor_das          sys_refcursor;',
'    cursor_da_acts      sys_refcursor;',
'    cursor_proc         sys_refcursor;',
'    cursor_items        sys_refcursor;',
'    cursor_pl           sys_refcursor;',
'    cursor_pl_attr      sys_refcursor;',
'    cursor_pl_attr_val  sys_refcursor;',
'    cursor_pl_std_attrs sys_refcursor;',
'    cursor_pl_events    sys_refcursor;',
'',
'begin',
'    if p_mode = ''page-designer''',
'    then',
'        l_page_id := p_page_id;',
'    else',
'        l_page_id := p_val_page_id;',
'        ',
'        select plugin_type',
'          into l_plugin_type',
'          from apex_appl_plugins',
'         where application_id = l_app_id',
'           and name           = p_plugin_name',
'        ;',
'    end if;',
'    ',
'    -- Plug-in data',
'    open cursor_pl',
'     for select plugin_id',
'              , plugin_type',
'              , name',
'              , display_name',
'              , standard_attributes',
'              , help_text',
'              , attribute_01',
'              , attribute_02',
'              , attribute_03',
'              , attribute_04',
'              , attribute_05',
'              , attribute_06',
'              , attribute_07',
'              , attribute_08',
'              , attribute_09',
'              , attribute_10',
'              , attribute_11',
'              , attribute_12',
'              , attribute_13',
'              , attribute_14',
'              , attribute_15',
'           from apex_appl_plugins',
'          where application_id = l_app_id',
'            and name not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and (',
'                    (',
'                        p_mode       = ''page-designer''',
'                    and (',
'                            name in ( select substr(action_code,8)',
'                                        from apex_application_page_da_acts',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                         or name in ( select substr(source_type_code,8)',
'                                        from apex_application_page_regions',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                        or name in ( select substr(process_type_code,8)',
'                                        from apex_application_page_proc',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                        or name in ( select substr(display_as_code,8)',
'                                        from apex_application_page_items',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                        )',
'                    )',
'                 or (',
'                         p_mode = ''plugin-showcase''',
'                     and name   = p_plugin_name',
'                    )',
'                )',
'    ;',
'    -- Plug-in standard attributes',
'    open cursor_pl_std_attrs',
'     for select plugin_id',
'              , name',
'              , default_value',
'              , examples',
'              , help_text',
'           from apex_appl_plugin_std_attrs',
'          where application_id = l_app_id',
'            and plugin_name  not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and (',
'                    (',
'                        p_mode = ''page-designer''',
'                    and (',
'                        plugin_name in (  select substr(action_code,8)',
'                                            from apex_application_page_da_acts',
'                                           where application_id = l_app_id',
'                                             and page_id        = l_page_id',
'                                       )',
'                     or plugin_name in (  select substr(source_type_code,8)',
'                                            from apex_application_page_regions',
'                                           where application_id = l_app_id',
'                                             and page_id        = l_page_id',
'                                       )',
'                     or plugin_name in ( select substr(process_type_code,8)',
'                                           from apex_application_page_proc',
'                                          where application_id  = l_app_id',
'                                            and page_id         = l_page_id',
'                                       )',
'                     or plugin_name in ( select substr(display_as_code,8)',
'                                           from apex_application_page_items',
'                                          where application_id  = l_app_id',
'                                            and page_id         = l_page_id',
'                                       )',
'                    )',
'                 or p_mode = ''plugin-showcase''',
'                and plugin_name = p_plugin_name        ',
'           ))',
'    ;',
'    -- Plug-in attributes',
'    open cursor_pl_attr',
'     for select plugin_attribute_id',
'              , plugin_id',
'              , attribute_sequence',
'              , display_sequence',
'              , prompt',
'              , attribute_type',
'              , is_required',
'              , default_value',
'              , depending_on_attribute_id',
'              , depending_on_condition_type',
'              , depending_on_expression',
'              , examples',
'              , help_text',
'              , attribute_scope',
'              , unit',
'           from apex_appl_plugin_attributes',
'          where application_id  = l_app_id',
'            and plugin_name   not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and attribute_scope in(''Component'', ''COLUMN'')',
'            and (',
'                    (',
'                        p_mode = ''page-designer''',
'                    and (',
'                            plugin_name in ( select substr(action_code,8)',
'                                               from apex_application_page_da_acts',
'                                              where application_id = l_app_id',
'                                                and page_id        = l_page_id',
'                                           )',
'                         or plugin_name in ( select substr(source_type_code,8)',
'                                               from apex_application_page_regions',
'                                              where application_id = l_app_id',
'                                                and page_id        = l_page_id',
'                                           )',
'                         or plugin_name in ( select substr(process_type_code,8)',
'                                               from apex_application_page_proc',
'                                              where application_id  = l_app_id',
'                                                and page_id         = l_page_id',
'                                           )',
'                        or plugin_name in ( select substr(display_as_code,8)',
'                                               from apex_application_page_items',
'                                              where application_id  = l_app_id',
'                                                and page_id         = l_page_id',
'                                           )',
'                        )',
'                     or p_mode = ''plugin-showcase''',
'                    and plugin_name = p_plugin_name',
'               ))',
'       order by display_sequence',
'    ;',
'    -- Plug-in attribute values',
'    open cursor_pl_attr_val',
'     for select plugin_attribute_value_id',
'              , plugin_attribute_id',
'              , plugin_attribute_prompt',
'              , display_sequence',
'              , display_value',
'              , return_value',
'              , help_text',
'           from apex_appl_plugin_attr_values',
'          where application_id       = l_app_id',
'            and plugin_attribute_id in ( select plugin_attribute_id',
'                                           from apex_appl_plugin_attributes',
'                                          where application_id = l_app_id',
'                                            and plugin_name   not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'                                            and (',
'                                                    (',
'                                                        p_mode = ''page-designer''',
'                                                    and (',
'                                                            plugin_name in ( select substr(action_code,8)',
'                                                                               from apex_application_page_da_acts',
'                                                                              where application_id = l_app_id',
'                                                                                and page_id        = l_page_id',
'                                                                           )',
'                                                         or plugin_name in ( select substr(source_type_code,8)',
'                                                                               from apex_application_page_regions',
'                                                                              where application_id  = l_app_id',
'                                                                                and page_id         = l_page_id',
'                                                                           )',
'                                                         or plugin_name in ( select substr(process_type_code,8)',
'                                                                               from apex_application_page_proc',
'                                                                              where application_id  = l_app_id',
'                                                                                and page_id         = l_page_id',
'                                                                           )',
'                                                        or plugin_name in ( select substr(display_as_code,8)',
'                                                                               from apex_application_page_items',
'                                                                              where application_id  = l_app_id',
'                                                                                and page_id         = l_page_id',
'                                                                           )',
'                                                        )',
'                                                    )',
'                                                 or (',
'                                                         p_mode = ''plugin-showcase''',
'                                                     and plugin_name = p_plugin_name',
'                                                    )',
'                                                )',
'                                       )',
'       order by display_sequence',
'    ;',
'    -- in any case we need the plug-in data',
'    apex_json.initialize_clob_output;',
'    apex_json.open_object;',
'    apex_json.write(''plugin''        , cursor_pl);',
'    apex_json.write(''pluginStdAttr'' , cursor_pl_std_attrs);',
'    apex_json.write(''pluginAttr''    , cursor_pl_attr);',
'    apex_json.write(''pluginAttrVal'' , cursor_pl_attr_val);',
'    ',
'    -- get the plug-in settings only if it''s required',
'    if p_mode = ''page-designer'' or p_inc_values = ''Y''',
'    then',
'        -- Region',
'        if l_plugin_type = ''Region Type'' or p_mode = ''page-designer''',
'        then',
'            open cursor_regions',
'             for select region_name',
'                      , parent_region_id',
'                      , static_id',
'                      , display_sequence',
'                      , display_position_code',
'                      , region_source',
'                      , source_type',
'                      , source_type_code',
'                      , condition_type',
'                      , init_javascript_code',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , attribute_16',
'                      , attribute_17',
'                      , attribute_18',
'                      , attribute_19',
'                      , attribute_20',
'                      , attribute_21',
'                      , attribute_22',
'                      , attribute_23',
'                      , attribute_24',
'                      , attribute_25',
'                      , region_id',
'                   from apex_application_page_regions',
'                  where application_id   = l_app_id',
'                    and page_id          = l_page_id',
'                    and case when p_instance_id is not null then nvl(static_id,''x'') else ''x'' end = nvl(p_instance_id,''x'')',
'                  order by display_sequence',
'            ;',
'',
'            apex_json.write(''regions'', cursor_regions);',
'            ',
'            -- region columns',
'            -- @todo: the * has to be replaced with a proper list',
'            open cursor_region_cols',
'              for select *',
'                    from apex_application_page_reg_cols',
'                   where application_id = l_app_id',
'                     and page_id = l_page_id',
'                   order by display_sequence',
'            ;',
'            ',
'            apex_json.write(''regionCols'', cursor_region_cols);',
'            ',
'            -- classic report columns',
'            open cursor_cls_rpt_cols',
'             for select region_report_column_id',
'                      , region_id',
'                      , display_sequence',
'                      , display_as_code',
'                      , heading_alignment',
'                      , heading',
'                      , column_alias',
'                      , column_comment',
'                      , column_is_hidden',
'                   from apex_application_page_rpt_cols',
'                  where application_id = l_app_id',
'                    and page_id = l_page_id',
'                  order by display_sequence',
'            ;',
'              ',
'            apex_json.write(''clsRptCols'', cursor_cls_rpt_cols);',
'            ',
'        end if;',
'        -- Dynamic Action    ',
'        if l_plugin_type = ''Dynamic Action'' or p_mode = ''page-designer''',
'        then',
'            open cursor_das',
'             for select dynamic_action_name',
'                      , dynamic_action_sequence',
'                      , when_element',
'                      , when_selection_type',
'                      , when_selection_type_code',
'                      , when_region',
'                      , when_button',
'                      , when_event_internal_name',
'                      , when_event_name',
'                      , when_event_custom_name',
'                      , when_condition',
'                      , when_expression',
'                      , when_event_scope',
'                      , condition_type',
'                      , condition_type_code',
'                      , dynamic_action_id',
'                   from apex_application_page_da',
'                  where application_id = l_app_id',
'                    and page_id        = l_page_id',
'               order by dynamic_action_sequence',
'            ;',
'',
'            open cursor_da_acts',
'             for select dynamic_action_id',
'                      , action_name',
'                      , action_code',
'                      , action_sequence',
'                      , dynamic_action_event_result',
'                      , execute_on_page_init',
'                      , affected_elements',
'                      , affected_elements_type',
'                      , affected_region',
'                      , affected_button',
'                      , init_javascript_code',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , stop_execution_on_error',
'                      , wait_for_result',
'                      , component_comment',
'                      , action_id',
'                   from apex_application_page_da_acts',
'                  where application_id = l_app_id',
'                    and page_id        = l_page_id',
'               order by action_sequence',
'            ;',
'            ',
'            open cursor_pl_events',
'             for select plugin_id',
'                      , name',
'                      , display_name',
'                   from apex_appl_plugin_events',
'                  where application_id = l_app_id ',
'            ;',
'            apex_json.write(''das'', cursor_das);',
'            apex_json.write(''daActs'', cursor_da_acts);',
'            apex_json.write(''pluginEvents'', cursor_pl_events);',
'        end if;',
'        -- Process',
'        if l_plugin_type = ''Process Type'' or p_mode = ''page-designer''',
'        then',
'            open cursor_proc',
'             for select process_name',
'                      , execution_sequence',
'                      , process_point_code',
'                      , process_type',
'                      , process_type_code',
'                      , process_type_plugin_name',
'                      , process_source',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , error_display_location',
'                      , condition_type',
'                      , condition_type_code',
'                      , component_comment',
'                      , process_id',
'                   from apex_application_page_proc',
'                  where application_id = l_app_id',
'                    and page_id = l_page_id',
'               order by execution_sequence  ',
'            ;',
'            apex_json.write(''proc'', cursor_proc);',
'        end if;',
'        ',
'        if l_plugin_type = ''Item Type'' or p_mode = ''page-designer''',
'        then',
'            open cursor_items',
'             for select item_name',
'                      , display_as',
'                      , display_as_code',
'                      , item_data_type',
'                      , display_sequence',
'                      , region',
'                      , region_id',
'                      , label',
'                      , init_javascript_code',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , condition_type',
'                      , component_comment',
'                      , item_id',
'                   from apex_application_page_items',
'                  where application_id = l_app_id',
'                    and page_id = l_page_id',
'               order by display_sequence  ',
'            ;',
'            apex_json.write(''items'', cursor_items);',
'        end if;',
'        ',
'    end if;',
'',
'    apex_json.close_object;',
'',
'    l_result := apex_json.get_clob_output;',
'',
'    apex_json.free_output;',
'',
'    return l_result;',
'end get_page_data;',
'',
'--------------------------------------------------------------------------------',
'--',
'--------------------------------------------------------------------------------',
'function render',
'  ( p_region              in apex_plugin.t_region',
'  , p_plugin              in apex_plugin.t_plugin',
'  , p_is_printer_friendly in boolean',
'  )',
'return apex_plugin.t_region_render_result',
'as',
'    l_result apex_plugin.t_region_render_result;',
'',
'    l_region_id           varchar2(100)              := p_region.static_id;',
'',
'    l_mode                p_region.attribute_01%type := p_region.attribute_01;',
'    -- Mode -> page-designer',
'    l_app_id              p_region.attribute_02%type := nvl(p_region.attribute_02, :APP_ID);',
'    l_page_id             p_region.attribute_03%type := nvl(p_region.attribute_03, :APP_PAGE_ID);',
'    l_page_name           varchar2(250);',
'    l_show_components     p_region.attribute_04%type := p_region.attribute_04;',
'    l_comp_filter         p_region.attribute_05%type := p_region.attribute_05;',
'    l_tabs                p_region.attribute_11%type := p_region.attribute_11;',
'    -- Mode -> plugin-showcase',
'    l_plugin_name         p_region.attribute_06%type := upper(p_region.attribute_06);',
'    l_include_values      p_region.attribute_07%type := case when l_mode = ''page-designer'' then ''Y'' else p_region.attribute_07 end;',
'    l_values_page_id      p_region.attribute_08%type := nvl(p_region.attribute_08, :APP_PAGE_ID);',
'    l_instance_id         p_region.attribute_09%type := p_region.attribute_09;',
'',
'    l_min_height          p_region.attribute_10%type := p_region.attribute_10;',
'',
'    l_clob                clob;',
'',
'    l_init_js_fn          varchar(255) := ''init''||p_region.id;',
'',
'    l_page_data           clob;',
'',
'    procedure htpclob',
'      ( p_clob in out nocopy clob',
'      )',
'    is',
'        l_chunk varchar2(32000);',
'        l_clob  clob := p_clob;',
'    begin',
'        while length(l_clob) > 0',
'        loop',
'            begin',
'              if length(l_clob) > 16000',
'              then',
'                 l_chunk:= substr(l_clob,1,16000);',
'                 htp.prn(l_chunk);',
'                 l_clob:= substr(l_clob,length(l_chunk)+1);',
'              else',
'                 l_chunk := l_clob;',
'                 sys.htp.prn(l_chunk);',
'                 l_clob:='''';',
'                 l_chunk := '''';',
'              end if;',
'            end;',
'        end loop;',
'    end htpclob;',
'',
'begin',
'',
'    if apex_application.g_debug',
'    then',
'        apex_plugin_util.debug_region',
'          ( p_plugin => p_plugin',
'          , p_region => p_region',
'          );',
'    end if;',
'',
'    l_page_data := get_page_data',
'                     ( p_mode          => l_mode',
'                     , p_inc_values    => l_include_values',
'                     , p_app_id        => l_app_id',
'                     , p_page_id       => l_page_id',
'                     , p_val_page_id   => l_values_page_id',
'                     , p_plugin_name   => l_plugin_name',
'                     , p_instance_id   => l_instance_id ',
'                     );',
'',
'    sys.htp.p(''<div class="ap-plugin-container" id="attrBigCon_''|| l_region_id ||''">'');',
'    sys.htp.p(''    <div class="a-TabsContainer resize ui-tabs--simpleInset a-Tabs--pageDesignerTabs"  id="leftTree''|| l_region_id ||''">'');',
'    sys.htp.p(''        <div class="a-Tabs-toolbar a-Toolbar">'');',
'    sys.htp.p(''            <ul>'');',
'',
'    if l_mode = ''page-designer''',
'    then',
'        if instr(l_tabs, ''rendering'') > 0 then',
'            sys.htp.p(''                <li>'');',
'            sys.htp.p(''                    <a href="#rendering_container''|| l_region_id ||''">'');',
'            sys.htp.p(''                        <span title="Rendering" class="a-Icon icon-pd-rendering"></span>'');',
'            sys.htp.p(''                        <span class="a-Tabs-label">Rendering</span>'');',
'            sys.htp.p(''                    </a>'');',
'            sys.htp.p(''                </li>'');',
'        end if;',
'        if instr(l_tabs, ''dynamic-actions'') > 0 then',
'            sys.htp.p(''                <li>'');',
'            sys.htp.p(''                    <a href="#dynActTree_container''|| l_region_id ||''">'');',
'            sys.htp.p(''                        <span title="Dynamic Actions" class="a-Icon icon-pd-dynact"></span>'');',
